エンジェルアイ（LEDリング）とLEDデイライトを装備したプロジェクターヘッドライトです。事故の破損時や、経年劣化での黄ばみや汚れなどでお悩みの方にお勧めです。純正新品は非常に高価ですが、この製品だと安価に交換が可能です。新車のようなすっきりした見た目になります。カプラーオン接続が可能です。<br><br>●HID車用 ●左右セット ●バルブ規格：ロービームD1R（バルブとバラストは付属しません）・ハイビームH1（バルブ付属） ●光軸調整機能 ●ウインカーバルブ付属 ●パーキングランプバルブ付属 ●サイドマーカー装備（バルブ付属） ●LEDデイライト<br><br>【LEDの球切れ、水漏れ（レンズ接合部からの水滴の浸入）に対してご購入されてから1年間完全保証いたします。※保証が適用されるのは製品本体に保証番号の付いたSONAR正規品のみとなりますのでご了承下さい。】<br><br><br>対応車種：02-06 キャデラック エスカレード HID車<br><br>ランプ、レンズ | ヘッドランプ<br>キャデラック | エスカレード | 全モデル <br>※メーカー在庫切れの場合は納期を別途ご案内いたします。<tr><td colspan="2">
